        /// <summary>Returns the Vector2 element at a specified index.</summary>
        unsafe public ref Vector2 this[int index]
        {
            get
            {
#if ENABLE_UNITY_COLLECTIONS_CHECKS
                if ((uint)index >= 3)
                    throw new System.ArgumentException("index must be between[0...2]");
#endif
                fixed (Vector2x3* array = &this) { return ref ((Vector2*)array)[index]; }
            }
        }

